-- DROP TABLE IF EXISTS energy_usage_hourly;

CREATE TABLE public.energy_usage_hourly (
  "Timestamp" TIMESTAMP,
  "Device" TEXT,
  "Power(W)" INTEGER,
  "Energy Consumption(kWh)" DOUBLE PRECISION,
  "Voltage" DOUBLE PRECISION,
  "Current" DOUBLE PRECISION,
  "Active Power (kW)" DOUBLE PRECISION,
  "Frequency (Hz)" DOUBLE PRECISION,
  "Power Factor" DOUBLE PRECISION,
  "Active Energy (kWh)" DOUBLE PRECISION
);

COMMIT;
